import React, { Component } from 'react';
import store from '../../reduxState/store';

class WebPreview extends Component {

    componentDidMount() {
        let webElements = store.getState().webPreview[0].webPreview.map(data => data)
        document.getElementById('web-preview').innerHTML = webElements;

        Array.from(document.getElementsByClassName('temporary-elements')).map(el => el.remove())

        Array.from(document.getElementsByClassName('new-element-wrapper')).forEach( element => 
            element.style.background = 'white')
    }

    render() {
        return (
            <div>
                <div id='web-preview'>
                </div>
            </div>
        );
    }
}

export default WebPreview;
